import React from 'react';

const Profile = () => {
  return (
    <div className='min-h-screen bg-valorant-dark py-12 px-4'>
      <div className='max-w-md mx-auto'>
        <h1 className='text-3xl text-white text-center'>PROFILE</h1>
        <div className='bg-valorant-gray-800 rounded-lg p-6 mt-8'>
          <h3 className='text-lg text-white mb-4'>Player Stats</h3>
          <div className='text-white'>ELO: 1250</div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
